using ObjectiveC;using System;using SwiftSharp.Attributes;using System.Collections.Generic;using Foundation;using CoreGraphics;namespace UIKit{    /// <summary>    /// A snap behavior defines a dynamic item’s movement to a specified point; the movement proceeds with a spring-like effect, ending with an oscillation whose amount you can set.    /// </summary>    /// <see cref="https://developer.apple.com/library/prerelease/ios/documentation/UIKit/Reference/UISnapBehavior_Class/index.html#//apple_ref/occ/cl/UISnapBehavior"/>    [iOSVersion(7)]    public class UISnapBehavior : UIDynamicBehavior//, AnyObject, NSObjectProtocol    {        /// <summary>        /// Initializes a snap behavior with a dynamic item and a snap point.        /// </summary>        /// <param name="item">The dynamic item that you want to apply a snap behavior to.</param>        /// <param name="snapToPoint">The point that you want the dynamic item to snap to. The coordinate system for the point parameter depends on how you initialize the dynamic animator you’re adding the snap behavior to, as described in the overview of UIDynamicAnimator Class Reference.</param>        [iOSVersion(7)]        public UISnapBehavior(UIDynamicItem item, CGPoint snapToPoint) { }                /// <summary>        /// The amount of oscillation of a dynamic item during the conclusion of a snap.        /// </summary>        [iOSVersion(7)]        [Export("damping")]        public CGFloat Damping { get; set; }    }}